import React from 'react';
import ReactDOM from 'react-dom';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';

export default ({ positions }) => (
    <Paper>
        <Tabs
         value={0} //which tab will be underlined, here tab 2, which is the center tab
         
         indicatorColor="primary"
         textColor="primary"
         centered
         >
         <Tab label="All" />
         
         {positions.map(group => //grabbing list of food items
            <Tab label={group} />
         )}
          
         <TabPanel value={value} index={0}>
             Item One
         </TabPanel>
         <TabPanel value={value} index={1}>
             Item Two
         </TabPanel>
         <TabPanel value={value} index={2}>
             Item Three
         </TabPanel>
         
         <List> 
          {/*list items inside drawer*/}
          {food_categories.map((item, index) => (
            <ListItem button onClick={() => onSelect(item)} key={item}>
              <ListItemText primary={item} />
            </ListItem>
          ))}
        </List>


         </Tabs>
    </Paper>
);
